import "./App.css";

function App() {
  function fJsGrid() {
    let data = [];
    for (let i = 0; i < 10; i++) {
      data.push([]);
      for (let j = 0; j < 10; j++) {
        data[i].push(0);
      }
    }
    // console.table(data);
    return data;
  }
  let jsGrid = fJsGrid();
  // console.table(jsGrid);
  return (
    <div className="App">
      {jsGrid.map(row => row.map(col => <div>`{col}-{row}`</div>))}
    </div>
  );
}

export default App;
